    public static int lengthOfLongestSubstring(String s) {
        char[] chars = s.toCharArray();
        HashMap<Character, Integer> map = new HashMap<>();
        int len = 0;
        int max = 0;
        for (int i = 0; i < chars.length; i++) {
            char aChar = chars[i];
            boolean b = map.containsKey(aChar);
            if (b) {
                i = map.get(aChar);
                map.clear();
                len = 0;
            } else {
                map.put(aChar, i);
                max = Math.max(max, ++len);
            }
        }
        return max;
    }


    public static int lengthOfLongestSubstring1(String s) {
        int[] last = new int[128];
        char[] chars = s.toCharArray();
        int n = chars.length;
        int space = 0;
        for (int i = 0; i < n; i++) {
            char aChar = chars[i];
            int index = last[aChar];

            if (index != 0) {
                last[aChar] = 0;
                space = Math.max(space, i - index);
            }
        }
        return 3;
    }

    public static int lengthOfLongestSubstring2(String s) {
        // 记录字符上一次出现的位置
        int[] last = new int[128];
//        for (int i = 0; i < 128; i++) {
//            last[i] = -1;
//        }
        int n = s.length();

        int space = 0;
        int start = 0; // 窗口开始位置
        for (int i = 0; i < n; i++) {
            int index = s.charAt(i);
            start = Math.max(start, last[index]);

            space = Math.max(space, i - start);
            last[index] = i;
        }

        return space;
    }

